import React, { useEffect, useState } from "react";
import api from "../../../../../service/api";
import { Body, ContainerDouble, ContainerList, ContainerListText, FormCoitainer, MonitorList } from "./styled";
import { DataTable } from 'primereact/datatable';
import { Column } from "primereact/column";
import { Button } from 'primereact/button';
import 'primeicons/primeicons.css';
import 'primereact/resources/themes/lara-light-indigo/theme.css';
import 'primereact/resources/primereact.css';
import 'primeflex/primeflex.css';



const FinishPez = () => {
    const [monitores, setMonitores] = useState([])

    const getMonitor = () => {
        api.get('/takemonitor')
        .then((res) => {
            setMonitores(res.data)
        })
        .catch((err) => {
            console.log(err)
        })
    }

    const paginatorLeft = <Button type="button" icon="pi pi-refresh" className="p-button-text" />;
    const paginatorRight = <Button type="button" icon="pi pi-cloud" className="p-button-text" />;

    useEffect(() => {
        getMonitor()
    },[monitores])

    return(
        <Body>
            <FormCoitainer>
                <ContainerDouble>
                <DataTable value={monitores} paginator responsiveLayout="scroll"
                    paginatorTemplate="CurrentPageReport FirstPageLink PrevPageLink PageLinks NextPageLink LastPageLink RowsPerPageDropdown"
                    currentPageReportTemplate="Showing {first} to {last} of {totalRecords}" rows={10} rowsPerPageOptions={[10,20,50]}
                    paginatorLeft={paginatorLeft} paginatorRight={paginatorRight}>
                    <Column field="name" header="Name"></Column>
                    <Column field="pesinhos" header="Pezinho"></Column>
                    <Column field="avulso" header="Pontos por Aulas Avulsas"></Column>
                    <Column field="subs" header="Pontos por Substituição"></Column>
                </DataTable>
                </ContainerDouble>
            </FormCoitainer>
        </Body>
    )
}

export default FinishPez;
